SET NAMES 'utf8';

DROP DATABASE IF EXISTS diabetes;

CREATE DATABASE diabetes CHARACTER SET utf8 COLLATE utf8_general_ci;

GRANT ALL ON diabetes.* TO 'web_user'@'%' IDENTIFIED BY 'Password1';

USE diabetes;

CREATE TABLE diabetes_results 
(
    id int primary key auto_increment, 
    first_name	VARCHAR(512),
    last_name	VARCHAR(512),
    age	INT,
    gender	VARCHAR(512),
    location	VARCHAR(512),
    blood_sugar	DOUBLE
);

